// src/Sidebar.js
import React from 'react';
import styled from 'styled-components';

const SidebarWrapper = styled.div`
    width: 473px;
    height: 924px;
    background-color: #f4f4f4;
    padding: 20px;
    box-sizing: border-box;
    border-radius: 20px;
    margin: 50px 50px;
`;

const Sidebar = () => {
    return (
    <SidebarWrapper2>
        <SidebarWrapper>
            <h2>Sidebar</h2>
            <p>This is the sidebar content.</p>
        </SidebarWrapper>
    </SidebarWrapper2>

    );
};

export default Sidebar;
